import './BookInstance.css'

function getData(){
    document.addEventListener("DOMContentLoaded", function () {
        // Make a fetch request to your Flask API endpoint
        fetch("http://localhost:5000/api/scraped-data")
            .then(response => response.json())
            .then(data => {
                // Update the HTML with the scraped data
                return JSON.stringify(data, null, 2);
            })
            .catch(error => {
                console.error("Error fetching data:", error)
                return "NULL"
            });
    });
}

function Book(props){
    return (
        <>
            <p>{getData()}</p>
        </>
    )
}

export default Book;
